export default class Product extends Component{
    render() {
        return (
            <div className="card">
                <div className="card-body">
                    <div className="text-muted">

                    </div>
                </div>
               <p> Product #{this.props.id}</p>
               <p>Name {this.props.name}</p>
               <p>Price {this.props.price}</p>


            </div>
        )
    }
}
